import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [scrapeResult, setScrapeResult] = useState(null);
  const [captchaContent, setCaptchaContent] = useState(null);

  const handleScrape = async () => {
    try {
      const response = await axios.post('http://localhost:3000/scrape', {
        url: 'https://www.rvtrader.com/Class-B/rvs-for-sale?type=Class%20B%7C198068&zip=91361&radius=150',
        loginUrl: 'https://www.rvtrader.com/myt/login'
      });

      if (response.data.captcha) {
        setCaptchaContent(response.data.content);
      } else {
        setScrapeResult(response.data.content);
      }
    } catch (error) {
      console.error('Error during scraping:', error);
    }
  };

  return (
    <div className="App">
      <button onClick={handleScrape}>Scrape Data</button>
      {captchaContent && (
        <div>
          <h2>CAPTCHA Detected. Please solve it below:</h2>
          <iframe
            srcDoc={captchaContent}
            style={{ width: '100%', height: '500px', border: 'none' }}
            title="CAPTCHA"
          ></iframe>
        </div>
      )}
      {scrapeResult && (
        <div>
          <h2>Scrape Result:</h2>
          <pre>{scrapeResult}</pre>
        </div>
      )}
    </div>
  );
}

export default App;
